import PropTypes from 'prop-types';
import shortid from 'shortid';

const FeedbackOptions = ({ options, onLeaveFeedback }) => {
  return (
    <div className="btn_container">
      <button className="btn" onClick={this.handleGood}>
        Good
      </button>
      <button className="btn" onClick={this.handleNetural}>
        Netural
      </button>
      <button className="btn" onClick={this.handleBad}>
        Bad
      </button>
    </div>
  );
};

export default FeedbackOptions;
